import React from 'react';
import './App.css';

function LikeButton(){

  const clicked = () => {
    alert('ok')
  }
  return <button className="likeBtn like" onClick={()=> clicked}>Like</button>
}

function App() {
  return (
    <div className="App">
      <LikeButton />
    </div>
  );
}

export default App;
